import React, { useState } from 'react';
import axios from 'axios';
import './upload.css'; // Import the specific CSS file for UploadPage

const UploadPage = () => {
    const [file, setFile] = useState(null);
    const [loading, setLoading] = useState(false);
    const [extractedData, setExtractedData] = useState('');
    const [questions, setQuestions] = useState('');
    const [queryText, setQueryText] = useState('');
    const [rawText, setRawText] = useState('');

    // New state for additional inputs
    const [formData, setFormData] = useState({
        date: '',
        anFn: '',
        courseName: '',
        courseCode: '',
        semester: '',
        examType: ''
    });

    const handleFileChange = (e) => {
        setFile(e.target.files[0]);
        setRawText(''); // Reset rawText when file is selected
    };

    const handleFormChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async () => {
        if (!file && !rawText) return; // Ensure at least one input is provided

        setLoading(true);
        try {
            if (file) {
                const formDataToSend = new FormData();
                formDataToSend.append('file', file);
                formDataToSend.append('queryText', queryText);
                // Append additional form data to send
                Object.keys(formData).forEach((key) => {
                    formDataToSend.append(key, formData[key]);
                });

                const response = await axios.post('http://localhost:3322/upload', formDataToSend);
                setExtractedData(response.data.extractedData);
                setQuestions(response.data.questions);
            } else if (rawText) {
                const response = await axios.post('http://localhost:3322/query', {
                    rawText,
                    queryText,
                    ...formData
                });
                setExtractedData(rawText); // Set rawText as extractedData
                setQuestions(response.data.queryResult); // Set queryResult as questions
            }
        } catch (error) {
            console.error('Error processing the input:', error);
        } finally {
            setLoading(false);
        }
    };

    const handleQueryTextChange = (e) => {
        setQueryText(e.target.value);
    };

    const handleRawTextChange = (e) => {
        setRawText(e.target.value);
        setFile(null); // Reset file when rawText is entered
    };

    return (
        <div className="upload-page-container">
            <div className="upload-form-container">
                {/* Form fields for question paper details */}
                <h3>Fill Question Paper Details</h3>
                <input
                    type="text"
                    name="date"
                    value={formData.date}
                    onChange={handleFormChange}
                    placeholder="Date (e.g., 19.05.2023)"
                    className="upload-query-input"
                />
                <input
                    type="text"
                    name="anFn"
                    value={formData.anFn}
                    onChange={handleFormChange}
                    placeholder="AN/FN"
                    className="upload-query-input"
                />
                <input
                    type="text"
                    name="courseName"
                    value={formData.courseName}
                    onChange={handleFormChange}
                    placeholder="Course Name (e.g., CLOUD COMPUTING)"
                    className="upload-query-input"
                />
                <input
                    type="text"
                    name="courseCode"
                    value={formData.courseCode}
                    onChange={handleFormChange}
                    placeholder="Course Code (e.g., A30536)"
                    className="upload-query-input"
                />
                <input
                    type="text"
                    name="semester"
                    value={formData.semester}
                    onChange={handleFormChange}
                    placeholder="Semester (e.g., B.Tech VI Semester)"
                    className="upload-query-input"
                />
                <input
                    type="text"
                    name="examType"
                    value={formData.examType}
                    onChange={handleFormChange}
                    placeholder="Exam Type (e.g., Regular/Supply)"
                    className="upload-query-input"
                />
            </div>
            <div className="upload-form-container">
                {/* Common input fields */}
                <input type="file" onChange={handleFileChange} className="upload-input" />
                <textarea
                    value={rawText}
                    onChange={handleRawTextChange}
                    placeholder="Enter raw text to query"
                    className="upload-raw-text-input"
                />
                <input
                    type="text"
                    value={queryText}
                    onChange={handleQueryTextChange}
                    placeholder="Enter prompt for Gemini AI"
                    className="upload-query-input"
                />
                <button onClick={handleSubmit} className="upload-button" disabled={loading}>
                    {loading ? 'Processing...' : 'Submit'}
                </button>
            </div>
        </div>
    );
};

export default UploadPage;
